import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankenstein",
        },
        {
          name: "Hulk",
        },
        {
          name: "Freaky",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">
        {this.state.monsters.map((monster) => {
          return <h1>{this.state.monster.name}</h1>;
        })}
      </div>
    );
  }
}

export default App;
